import ChatRightSidebar from "../components/ChatRightSidebar";
import ChatLeftSidebar from "./../components/ChatLeftSidebar";

const Home: React.FC = () => {
  return (
    <>
      <ChatLeftSidebar />
      <ChatRightSidebar />
    </>
  );
};

export default Home;
